import React, { Component } from 'react';



export default class LayoutTemplateBanner extends Component {

    constructor(props) {
        super(props);
        this.state = {
            misPhotos: []
        }
    }

    componentWillMount(){
        let { misPhotos } = this.state;
        console.log("lenght: ", misPhotos.length)
        for (let i = 1; i < 27; i++) {
            misPhotos.push({"number": i})
        }
        console.log(misPhotos)
        this.setState({misPhotos: misPhotos})
    }

    render() {

        return (
            <div class="banner haslayout" style={{ backgroundColor:"#f7f7f7"}}>
                <div class="slider-caption">
                    <div class="box">
                        <div class="holder">
                            <div class="frame">
                                <div class="border-center">
                                    <span class="title">Ceci'Style</span>
                                </div>
                                <div class="border-center">
                                    <h1>Design & <span>Alterations</span></h1>
                                </div>
                                <div class="description">
                                    <p style={{ fontWeight: "600", fontSize: "25px", lineHeight: "1.5", letterSpacing: "1px"}}>"Beauty begins the moment you decideto be yourself"</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div id="home-slider" class="home-slider">
                    {this.state.misPhotos.map((index) => {
                        return (<div key={index.number} class="item">
                            <img src={"../images/banner/cecistyle" + index.number + ".jpg"} alt="slider"/>
                        </div>)
                    })}
                </div>
            </div>
        )
    }
}
